import React from 'react';
import BoutonClique from './BoutonClique';
import BoutonBascule from './BoutonBascule';
import AppSuivi from './AppSuivi'; // Renommé pour plus de clarté
import Compteur from './Compteur';

function App() {
  return (
    <div>
      <h2>Exemple 1 - Bouton Cliqué</h2>
      <BoutonClique />

      <h2>Exemple 2 - Bouton Bascule</h2>
      <BoutonBascule />

      <h2>Exemple 3 - Suivi des clics</h2>
      <AppSuivi />

      <h2>Exemple 4 - Compteur</h2>
      <Compteur />
    </div>
  );
}

export default App;
